import React from 'react';
import ReactDOM from 'react-dom';

function createUl(listItemsCount) {
    var listI;
    for(let i = 0; i < listItemsCount; i++){
        listI += <li>i</li>;
    }
    return <ul>{listI}</ul>;
};

ReactDOM.render(createUl(5), document.getElementById('root'));
